p=A.G0('#### Das Wichtigste in K\xfcrze:\n* Sonderm\xfcll wie Alt\xf6l, Renovierungsabf\xe4lle, Leuchtstoffr\xf6hren oder Batterien geh\xf6ren nicht in den Hausm\xfcll. Sie m\xfcssen separat entsorgt werden.\n* Giftige Abf\xe4lle k\xf6nnen entweder am Schadstoffmobil des Entsorgers oder an einem der Recyclingh\xf6fe abgegeben werden. Die \xd6ffnungszeiten und Stationen des Schadstoffmobils erfahren Sie im Abfallkalender oder der Homepage ihres Entsorgers.\n* Auch einige H\xe4ndler nehmen Schadstoffe an, wenn sie damit Handeln. So kann Alt\xf6l da abgegeben werden, wo man neues kauft.\n* Mischen Sie fl\xfcssige Abf\xe4lle niemals und bewahren sie sie am besten im Originalbeh\xe4lter auf.\n\nIn vielen Haushaltsprodukten schlummern gef\xe4hrliche Schadstoffe. Die Mengen sind verh\xe4ltnism\xe4\xdfig klein, doch ihre sch\xe4dliche Wirkung auf die Umwelt ist gro\xdf.   \nSchwermetalle, Alt\xf6l oder giftige Chemikalien, die \xfcber den Hausm\xfcll in die Umwelt gelangen, k\xf6nnen Pflanzen und Tiere sch\xe4digen und sich in der Nahrungskette anreichern.  \n\nProdukte mit sch\xe4dlichen Inhaltsstoffen k\xf6nnen Verbraucher oft an besonderen Warnhinweisen auf der Verpackung erkennen. So steht das Symbol "Toter Baum und Fisch" f\xfcr umweltgef\xe4hrdende Stoffe, ein "Totenkopf" auf der Verpackung weist auf Giftigkeit hin, eine durchgestrichene M\xfclltonne auf Altbatterien auf Schwermetalle.  \nSolche Produkte m\xfcssen separat \xfcber Sonderm\xfcllannahmestellen entsorgt oder an den Handel zur\xfcckgegeben werden.  \n\nWir haben einige solcher problematischer Produkte aufgelistet und geben dazu die passenden Entsorgungstipps.  \n\n# Altbatterien und Akkus\nDamit ausgediente Akkus und Batterien nicht achtlos in der M\xfclltonne landen, sind Handel und Kommunen zur kostenlosen R\xfccknahme verpflichtet: \nVon der Knopfzelle \xfcber Ger\xe4teakkus bis hin zur Autobatterie - bei all diesen mobilen Energiespendern hei\xdft die oberste Nutzerpflicht: "Nach Gebrauch zur\xfcck".  \n\nTipps zur richtigen Entsorgung\n* Alle ausgepowerten Batterien und Akkus m\xfcssen im Handel zur\xfcckgegeben werden.  \n  Kommunen k\xf6nnen freiwillig zus\xe4tzliche Sammelstellen anbieten. Der Hausm\xfcll ist f\xfcr die schadstoffhaltigen Energiespender tabu.\n* Knopfzelle, Akku und Co. aller Marken k\xf6nnen kostenlos zur\xfcckgegeben werden - auch dann, wenn keine neuen Energiezellen gekauft werden. H\xe4ndler m\xfcssen jedoch nur die Typen zur\xfccknehmen, die sie auch im Sortiment f\xfchren oder gef\xfchrt haben.\n* Wer Starterbatterien aus dem Auto zur\xfcckgibt, braucht das Portemonnaie ebenfalls nicht zu z\xfccken, denn auch deren R\xfccknahme ist kostenlos. Wird beim Kauf einer neuen Batterie jedoch keine alte abgegeben, muss der H\xe4ndler 7,50 Euro Pfand verlangen - und darf diesen erst wieder auszahlen, wenn das ausgediente Kraftpaket abgeliefert wird.\n* Ger\xe4te mit fest eingebauten Batterien oder Akkus geh\xf6ren zum Elektroschrott und k\xf6nnen bei den kommunalen Sammelstellen, in gro\xdfen Elektrom\xe4rkten und im Onlinehandel kostenlos zur\xfcckgegeben werden.\n* Verbrauchte Akkus von Pedelecs oder Akkuwerkzeugen nimmt ebenfalls der Fachhandel an. Wichtig ist es, die Kontaktstellen der Akkus abzukleben, damit w\xe4hrend der weiteren Behandlung kein Schaden entsteht.\n* Und Achtung: Selbst die mit "0 % Hg, 0 % Cd" gekennzeichneten Batterien sind keineswegs schadstofffrei. In ihnen k\xf6nnen \xe4tzende, wasser- oder umweltgef\xe4hrdende Stoffe wie zum Beispiel Mangandioxid; Kalilauge oder Schwefels\xe4ure stecken.\n\n# Altmedikamente\nImmer mehr R\xfcckst\xe4nde von Medikamenten tauchen in Gew\xe4ssern auf. Denn die Kl\xe4ranlagen, die das Abwasser reinigen, sind keine Allesk\xf6nner. Ein sparsamerer Umgang mit Medikamenten entlastet deshalb nicht nur das eigene Budget, sondern auch B\xe4che, Stauseen und Fl\xfcsse. Von der Zur\xfcckhaltung profitiert das Konto erneut - weil andernfalls zunehmend kostspieligere Aufbereitungsverfahren n\xf6tig werden, um Grund- oder Flusswasser in den Wasserwerken zu reinigen und zu Trinkwasser aufzubereiten.  \n\n#### Tipps zur richtigen Entsorgung\n* Wer nur kleine Mengen an Medikamenten kauft, hat sp\xe4ter auch kein Entsorgungsproblem.\n* **In Entsorgungsgebieten, die an M\xfcllverbrennungsanlagen (MVA) angeschlossen sind**, k\xf6nnen abgelaufene oder nicht mehr ben\xf6tigte Arzneien in die graue Restm\xfclltonne geworfen werden. Das gilt auch f\xfcr angebrochene Glas-Fl\xe4schchen. Die Wirkstoffe der Medikamente verlieren bei der Verbrennung ihre \xf6kologische Sch\xe4dlichkeit. Hingegen d\xfcrfen Arzneimittel nie \xfcber die Toilette oder das Sp\xfclbecken entsorgt werden.  \n  Um Altmedikamente gegen eine missbr\xe4uchliche Verwendung zu sichern, empfiehlt es sich, sie vor dem Wurf in die Tonne in Zeitungspapier einzuwickeln.\n* Wer wirklich sicher gehen will, kann seine Altmedikamente auch in Apotheken zur\xfcck geben. Viele Apotheken bieten diesen Service freiwillig an.\n* **In Entsorgungsgebieten, die an eine mechanisch-biologische Abfallbehandlungsanlage (MBA) angeschlossen sind**, sollten die Altmedikamente bei der Sonderm\xfcllsammlung oder, sofern m\xf6glich, in Apotheken abgegeben werden. Leere Arzneimittel-Fl\xe4schchen geh\xf6ren in den Restm\xfcll, weil sie aus anderem Glas sind als herk\xf6mmliche Flaschen, leere Pillen-Blister-Verpackungen in den gelben Sack und leere Pappschachteln zum Altpapier.\n\n# Alt\xf6l\n...\n\n#### Source:\nhttps://www.verbraucherzentrale.de/wissen/umwelt-haushalt/abfall/schadstoffe-im-haushalt-kleine-menge-grosse-wirkung-13929\n',A.hj(l,2,12,0,0,0,0),p,B.Ow,"**Sonderm\xfcll wie Alt\xf6l, Renovierungsabf\xe4lle, Leuchtstoffr\xf6hren oder Batterien geh\xf6ren nicht in den Hausm\xfcll. Sie m\xfcssen separat entsorgt werden.**","Schadstoffe")
