o=A.G0('### Das Wichtigste in K\xfcrze\n* Elektroschrott k\xf6nnen Sie bei H\xe4ndlern abgeben. Ab dem 1. Juli 2022 auch in gro\xdfen Lebensmittelgesch\xe4ften/Discounter, die Elektroartikel verkaufen. \n* Auch der Online-Handel ist zur kostenlosen R\xfccknahme verpflichtet.\n* Bei gr\xf6\xdferen Alt-Ger\xe4ten erfolgt die R\xfccknahme im Tausch alt gegen neu.\n* Jede Kommune h\xe4lt Sammelstellen zur kostenlosen Abgabe bereit.\n\nKaputter F\xf6n, defekter Toaster, aussortierter Computer \u2013 vielfach gammeln ausgemusterte Ger\xe4te im Keller vor sich hin oder landen in der M\xfclltonne. \nSo fristen in Deutschland \xfcber 200 Millionen alte Handys ein "ungenutztes Dasein" in Schubladen. \nUnd auch Gro\xdfger\xe4te werden nicht sachgerecht entsorgt, sondern enden h\xe4ufig in undurchsichtigen Schrotth\xe4ndler-Kan\xe4len. \nBislang werden nur rund 45 Prozent des Elektroschrotts ordnungsgem\xe4\xdf entsorgt. \nDamit ist Deutschland meilenweit von der EU-weit vorgeschriebenen Sammelquote von 65 Prozent entfernt.   \n\nMit  dem novellierten Elektro- und Elektronikger\xe4tegesetz (ElektroG) soll die R\xfcckgabe ab 1. Juli 2022 f\xfcr Verbraucherinnen und Verbraucher einfacher werden. \nDenn nur wenn die elektrischen und elektronischen Oldies sachgerecht entsorgt werden, k\xf6nnen die verwendeten Rohstoffe in diesen Ger\xe4ten auch wieder recycelt werden.  \n\n## Wer muss was zur\xfccknehmen? Was gilt ab 1. Juli 2022?\nBislang galt, dass nur Gesch\xe4fte mit einer Verkaufsfl\xe4che von mehr als 400 Quadratmetern f\xfcr Elektroger\xe4te Altger\xe4te kostenfrei zur\xfccknehmen m\xfcssen.  \nNeu ist, dass ab dem 1. Juli 2022 auch Lebensmitteleinzelh\xe4ndler oder Discounter zur R\xfccknahme von Elektroaltger\xe4ten verpflichtet sind, deren gesamte Verkaufsfl\xe4che gr\xf6\xdfer als 800 Quadratmeter ist und die dauerhaft oder immer wieder Elektroger\xe4te vertreiben.  \n\nF\xfcr den Online-Handel gelten die gleichen gesetzlichen Bestimmungen zur kostenlosen R\xfccknahme von Elektroaltger\xe4ten wie f\xfcr den station\xe4ren Handel. \nSie sind zur R\xfccknahme verpflichtet, wenn Lager- und Versandfl\xe4chen gr\xf6\xdfer als 400 qm bzw. 800 qm sind. Da die Berechnung dieser Fl\xe4chen neu definiert wurde, fallen nun mehr Online-H\xe4ndler unter diese R\xfccknahmevorgaben. \nEine freiwillige R\xfccknahme ist immer m\xf6glich: Das machen einige kleinere H\xe4ndler und Hersteller auch schon l\xe4nger. \nDieser Service muss f\xfcr Verbraucher:innen kostenlos sein, lediglich Transportkosten k\xf6nnen in Rechnung gestellt werden.  \n\n### Kommunen sammeln weiterhin Elektroschrott\nF\xfcr die Sammlung von Elektro-Altger\xe4ten m\xfcssen Kommunen nach wie vor Sammelstellen (meist Recyclingh\xf6fe) vorhalten. \nDort k\xf6nnen Sie alle Altger\xe4te kostenlos abgeben. \nF\xfcr eine Abholung zu Hause \u2013 zum Beispiel mit dem Sperrm\xfcll \u2013 kann die Kommune allerdings Geb\xfchren verlangen.  \n\n### R\xfccknahmeangebote unterscheiden sich nach Ger\xe4tegr\xf6\xdfen\nGer\xe4te mit einer Kantenl\xe4nge unter 25 Zentimetern (also: jede Seite des Ger\xe4ts darf nicht l\xe4nger sein) m\xfcssen immer kostenlos zur\xfcckgenommen werden \u2013 unabh\xe4ngig davon, ob Sie es in dem bestimmten Laden gekauft haben oder dort ein neues Ger\xe4t kaufen. \nDarunter fallen zum Beispiel Toaster, Eier- oder Wasserkocher oder Smartphones. Die Gesch\xe4fte - eben auch Superm\xe4rkte und Discounter - k\xf6nnen daf\xfcr Sammeltonnen aufstellen. \nDie R\xfccknahme ist allerdings auf drei Ger\xe4te pro Ger\xe4teart bei der Abgabe beschr\xe4nkt. \nF\xfcr gr\xf6\xdfere Ger\xe4te gilt das Prinzip alt gegen neu: Wird ein Ger\xe4t gekauft, muss ein Ger\xe4t der gleichen Kategorie (z.B. Fernseher gegen Fernseher) kostenfrei zur\xfcckgenommen werden. Weitere "Klassiker" sind K\xfchlschr\xe4nke, Waschmaschinen und W\xe4schetrockner.  \n\n...\n\n#### Source:\nhttps://www.verbraucherzentrale.de/wissen/umwelt-haushalt/abfall/elektroschrott-diese-geraete-und-gegenstaende-gehoeren-ins-recycling-12861\n',A.hj(l,2,16,0,0,0,0),o,B.OA,"**Wohin mit Elektroschrott? Noch mehr H\xe4ndler m\xfcssen ausgediente Elektroger\xe4te zur\xfccknehmen. Lebensmittelgesch\xe4fte und Discounter sind ab dem 1. Juli 2022 zur R\xfccknahme verpflichtet. Online-Shops m\xfcssen f\xfcr eine verbraucherfreundlichere R\xfccknahme sorgen.**","Elektroschrott")
